23	Сергей	\N	\r\nНе порядочные!!!!! Нужна была коробка мкпп vw t5 2литра бензин,  моя коробка рассыпалась и пробит был корпус нужно было менять кпп полностью маина сломалась за 1000км от дома обьяснил свою ситуацию сказали помогут. Ездил к машине 1000км в одну сторону с братом машина была на платной стоянке + эвакуатор к мастерам + гостиница и т.д. забрал коробку с транспортной немного была подмята крышка поддон ,поставили коробку был скрежет от этой крышки на свой риск выпрямили сами его открутив ее в надежде что кроме этого нюансов не будет т.к. они уверяли что все проверено и четко(наша ошибка) устранили этот звук  на коробке был спилен номер ее соответствено насторожились но нам сказали не переживать все подобрано по вину мы поехали проверить коробку и оказалось что нам подсунули коробку от дизиля 1.9 они подходят машина стала тупая дохлая и скоростя очень очень длиные, остановились и услышали дребезжание с кпп проверяли мастера и сказали подшипникам первичного вала не хорошо надо ремонтировать. Связались с евро деталью нас начали грузить что коробка та от бензина просто от другой комлектации(чуш бред развод) но в обмене отказали из за того что мы сами выпрямили поддон крышку..... Не советую барыги не профессионалы не порядочные обманывают решать проблему в нашем случае отказались не смотря на то что подсунули другую коробку и спилили номер с нее . пусть им боком выдут эти деньги. А мне эта коробка уже сидит с перездами и .т.д. В 120000руб и + ремонт снова снимать коробку. Короче Не связывайтесь если не уверены	2019-05-02 15:46:33.583741	2019-05-02 15:46:33.583741	1	Уважаемый Сергей!\n1. КПП, высланная в Ваш адрес - с бензинового машинокомплекта. Известный факт, что КПП бывают "тяговые" и "скоростные", в силу чего и могут быть ощущения, отличные от прежней манеры вождения, и действительно, зависеть это может от комплектации автомобиля: короткий ли кузов, или maxi, грузовой фургон, или же каравелла/мультивэн... Все эти моменты можно с нами обсуждать, мы всегда идём на встречу Клиенту.\n2. Вами была вскрыта задняя крышка КПП, нарушены пломбы Продавца, которые, в свою очередь, и ставятся для того, что бы исключить все спорные моменты. Вами же эти пломбы были нарушены, а деталь вскрыта, что лишает нас возможности исключить подмену деталей или же умышленную порчу агрегата. Таким образом, Вы грубо нарушили, итак не из многочисленных условий Контракта, одно основное и очень важное: НЕ вскрывать агрегат, НЕ нарушать пломбы и метки Продавца - чем лишили себя права требовать обмен/возврат детали в рамках "Гарантийного случая". Мы очень сожалеем о происшедшем, но действующие правила приобретения Б/У агрегатов для всех едины, выработаны с учётом многолетнего опыта, и действуют таковые в мировой практике продаж Б/У агрегатов и не только их. Ещё раз, извините!  	\r\n 19.04.2015 23:33
